const Home: React.FC = () => {
  return (
    <>
      <BentoGrid>
        <MainContainer>
          <NavBar>hello</NavBar>
          <ProfileContainer>
            hello
            <StyledButton>Learn more about me</StyledButton>
          </ProfileContainer>
        </MainContainer>
        <SideContainer>Image here</SideContainer>
      </BentoGrid>
    </>
  );
};

export default Home;
